import React, { useState } from "react";
import { fetchContributionData } from "../services/fetchCommits";
import "../styles/styles.css";

const Dashboard = () => {
    const [selectedOrg, setSelectedOrg] = useState("");
    const [selectedRepo, setSelectedRepo] = useState("");
    const [selectedUser, setSelectedUser] = useState("");
    const [contributions, setContributions] = useState([]);

    const ORGANIZATIONS = {
        "HWAI-MarketIntel": ["EnrollmentTrendsUI-R4", "EnrollmentTrendsAPI-R4", "CompetitorAnalysisUI-R1", "CompetitorAnalysisAPI-R1"],
        "HWAI-NetworkIntel": ["PNCOneToManyUI-R1", "PNCOneToManyAPI-R1", "NetworkAdequacyUI-R1", "NetworkAdequacyAPI-R1", "NPISearchUI-R4", "ProviderNetworkComparisonUI-R4", "ProviderNetworkComparisonAPI-R4", "NPISearchAPI-R4"],
        "HWAI-XAI": ["ProductScorecardUI-R1", "BenefitSimulatorUI-R3.1", "BenefitSimulatorAPI-R3.1", "BenefitSimulatorAPI-R3", "ProductScorecardAPI-R1", "BenefitSimulatorUI-R3"],
        "HWAI-ProductIntel": ["ChatbotEOCUI-R1", "ChatbotEOCAPI-R1", "ChatbotEOCModel-R1", "PlanComparisonUI-R4", "PlanComparisonAPI-R4"],
        "HWAI-CST": ["LobbyClientUI-R1", "LobbyAdminServerAPI-R1", "LobbyHeartbeatAutomationUI-R1", "HubspotIntegrationAPI-R1", "LobbyMiddlewareAPI-R1", "LobbyAdminPanelUI-R1", "LobbyServerAPI-R1"]
    };

    const USERS = ["ArulTEG", "ArunPrem_APP", "deepesh-tech", "Mukul Kumar", "suneelkumar02", "dhorinaresh", "ankit_sde@hwai", "bindu-e", "Kritika-sharma12", "Promod Kr Verma", "satyajeet-HealthworksAI", "Rajeev Rawat", "vibhore-go", "vidushi-chaudhary"];

    const handleFetchData = async () => {
        if (!selectedOrg || !selectedRepo || !selectedUser) {
            alert("Please select an organization, repository, and user!");
            return;
        }
        const data = await fetchContributionData(selectedOrg, selectedRepo, selectedUser);
        setContributions(data);
    };

    return (
        <div className="dashboard-container">
            <h1>GitHub Contributions Dashboard</h1>

            <select onChange={(e) => setSelectedOrg(e.target.value)}><option>-- Select Organization --</option>{Object.keys(ORGANIZATIONS).map(org => <option key={org} value={org}>{org}</option>)}</select>
            <select onChange={(e) => setSelectedRepo(e.target.value)}><option>-- Select Repository --</option>{selectedOrg && ORGANIZATIONS[selectedOrg].map(repo => <option key={repo} value={repo}>{repo}</option>)}</select>
            <select onChange={(e) => setSelectedUser(e.target.value)}><option>-- Select User --</option>{USERS.map(user => <option key={user} value={user}>{user}</option>)}</select>

            <button onClick={handleFetchData}>Execute</button>
        </div>
    );
};

export default Dashboard;
